import { useState, useEffect } from 'react';

function App() {
	const [Todo, setTodo] = useState('');
	const onChange = (event) => setTodo(event.target.value);
	return (
		<div>
			<form>
				<input
					onChange={onChange}
					type='text'
					placeholder='Write your to do...'
				/>
			</form>
		</div>
	);
}

export default App;
